// https://qrbatch.com/barcode (without labels)
async function generateContentForQRCode() {
    const base64Image = '';

    try {
        const filePart = {
            "inline_data": {
                "mime_type": "image/png",
                "data": base64Image
            }
        };

        const textPart = {
            "text": "Extract the barcodes from a list of barcodes in the photo and output those values in CSV. The CSV should have two columns: 'header' (containing the index) and 'value' (containing the barcode value). The response should be a plain CSV string without any markdown formats. This CSV string will be used to fetch values from an API and process them accordingly."
        };

        const req = {
            "contents": [
                {
                    "role": "user",
                    "parts": [textPart, filePart]
                }
            ]
        };

        const streamingResp = await generativeModel.generateContentStream(req);
        const contentResponse = await streamingResp.response;

        const result = contentResponse.candidates[0]?.content?.parts[0]?.text;

        console.log('aggregated response: ' + csvToJSON(result));
    } catch (error) {
        console.error("err", error);
    }
}

function csvToJSON(csvData) {
    const lines = csvData.split('\n');
    const keys = lines[0].split(',').map(item => item.trim());
    console.log(keys);
    const jsonData = lines.slice(1).map((line) => {
        const values = line.split(',');
        const obj = {};
        keys.forEach((key, index) => {
            obj[key] = values[index].trim();
        });
        return obj;
    });

    // return jsonData;
    return JSON.stringify(jsonData);
}
